import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <div>
          <label style="display: block;">First name</label>
          <input id="firstName" name="firstName" defautValue="Test" />
        </div>
      </form>
    </div>
  );
}

export default App;
